DROP TABLE IF EXISTS house;

CREATE TABLE house (
    house_id SERIAL PRIMARY KEY,
    property VARCHAR,
    address VARCHAR,
    city VARCHAR,
    state VARCHAR,
    zip int,
    url VARCHAR,
    mortgage int,
    rent int
);
